description:
Animal story for children aged around 8-12 years of age.
* Take one puppy born without the ability to bark;
* Add one veterinarian who believes that dogs could talk, given the right surgery;
* Throw in a scientist who specialises in growing tissue.
What you get is a dog with a unique ability and an attitude problem.
That results in a confused family, offended neighbours, and some very scared cats!
